def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    min_path = [float('inf')] * k

    def dfs(x, y, path):
        nonlocal min_path
        if len(path) == k:
            min_path = min(min_path, path)
            return
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                dfs(nx, ny, path + [grid[nx][ny]])

    for i in range(N):
        for j in range(N):
            dfs(i, j, [grid[i][j]])

    return min_path

def tri(n):
    if n == 0:
        return [1]
    sequence = [1, 3]
    if n == 1:
        return sequence
    for i in range(2, n + 1):
        if i % 2 == 0:
            sequence.append(1 + i / 2)
        else:
            if i + 1 <= n:  # Check if the next element is within bounds
                sequence.append(sequence[i - 1] + sequence[i - 2] + (1 + (i + 1) / 2))
            else:
                sequence.append(sequence[i - 1] + sequence[i - 2] + sequence[i - 1])  # Use last element as tri(i + 1)
    return sequence

