def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    best_path = [float('inf')] * k

    def dfs(row, col, length, currentPath):
        if length == k:
            nonlocal best_path
            best_path = min(best_path, currentPath.copy())
            return
        if length > k:
            return
        for dr, dc in directions:
            newRow, newCol = row + dr, col + dc
            if 0 <= newRow < N and 0 <= newCol < N:
                currentPath.append(grid[newRow][newCol])
                dfs(newRow, newCol, length + 1, currentPath)
                currentPath.pop()

    for row in range(N):
        for col in range(N):
            dfs(row, col, 1, [grid[row][col]])

    return best_path

