def parse_nested_parens(paren_string: str) -> List[int]:
    groups = paren_string.split()
    depths = []
    for group in groups:
        depth = 0
        max_depth = 0
        for char in group:
            if char == '(':
                depth += 1
            elif char == ')':
                max_depth = max(max_depth, depth)
                depth -= 1
        depths.append(max_depth)
    return depths

