def starts_one_ends(n):
    """
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
    """
    if n == 1:
        return 2  # Special case for 1-digit numbers: only 1 and 11 meet the criteria
    else:
        # For n-digit numbers starting with 1: 10^(n-1) to 10^n - 1, there are 9 * 10^(n-2) numbers ending with 1
        # For n-digit numbers ending with 1: 10^(n-1) to 10^n - 1, there are 10^(n-1) possibilities
        # Subtract the overlap (numbers both starting and ending with 1), which is 10^(n-2)
        return 9 * 10**(n-2) + 10**(n-1) - 10**(n-2)

