def encode(message):
    def swap_case(ch):
        if ch.islower():
            return ch.upper()
        else:
            return ch.lower()

    def replace_vowel(ch):
        vowels = 'aeiouAEIOU'
        if ch in vowels:
            alphabet = 'abcdefghijklmnopqrstuvwxyz'
            index = alphabet.index(ch.lower())
            new_index = (index + 2) % 26
            new_ch = alphabet[new_index]
            if ch.isupper():
                return new_ch.upper()
            else:
                return new_ch
        else:
            return ch

    encoded_message = ''
    for ch in message:
        if ch.isalpha():
            ch = swap_case(ch)
            ch = replace_vowel(ch)
        encoded_message += ch
    return encoded_message

