def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    min_path = [float('inf')] * k

    def dfs(x, y, path):
        if len(path) == k:
            nonlocal min_path
            min_path = min(min_path, path)
            return
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                dfs(nx, ny, path + [grid[nx][ny]])

    for i in range(N):
        for j in range(N):
            dfs(i, j, [grid[i][j]])

    return min_path

def tri(n):
    """Return the first n + 1 numbers of the Tribonacci sequence."""
    if n == 0:
        return [3]
    seq = [3]
    for i in range(1, n + 1):
        if i % 2 == 0:
            seq.append(1 + (i / 2))
        else:
            if i == 1:
                seq.append(seq[i - 1])
            elif i == 2:
                seq.append(seq[i - 1] + seq[i - 2] + 3)  # tri(4) = 3, as per the given example
            else:
                seq.append(seq[i - 1] + seq[i - 2] + seq[i + 1 - 3])
    return seq

