def encode(message):
    """
    Encodes a message by swapping case of all letters and replacing all vowels with the letter 
    that appears 2 places ahead of that vowel in the english alphabet.
    """
    vowels = 'aeiouAEIOU'
    alphabet = 'abcdefghijklmnopqrstuvwxyz'
    encoded_message = ''

    for ch in message:
        if ch.isalpha():
            if ch in vowels:
                if ch.islower():
                    new_char = alphabet[(alphabet.index(ch.lower()) + 2) % 26]
                else:
                    new_char = alphabet[(alphabet.index(ch.lower()) + 2) % 26].upper()
            else:
                new_char = ch.swapcase()
            encoded_message += new_char
        else:
            encoded_message += ch
    return encoded_message

