    parts = date.split('-')
    # Check if the date string contains 3 parts after splitting. If not, return False.
    if len(parts) != 3:
        return False
    month, day, year = parts
    # Check if month, day, and year are all numeric values. If not, return False.
    if not (month.isdigit() and day.isdigit() and year.isdigit()):
        return False
    # Convert month, day, and year to integers.
    month, day, year = int(month), int(day), int(year)
    # Check if month is between 1 and 12 (inclusive). If not, return False.
    if month < 1 or month > 12:
        return False
    # Check if day is between 1 and 31 for months 1, 3, 5, 7, 8, 10, 12; 
    # between 1 and 30 for months 4, 6, 9, 11; and between 1 and 29 for February. If not, return False.
    if month in [1, 3, 5, 7, 8, 10, 12]:
        if day < 1 or day > 31:
            return False
    elif month in [4, 6, 9, 11]:
        if day < 1 or day > 30:
            return False
    elif month == 2:
        if day < 1 or day > 29:
            return False
    # If all conditions are satisfied, return True.
    return True

