def minPath(grid, k):
    from heapq import heappush, heappop
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    min_path = []

    def isValidCell(x, y):
        return 0 <= x < N and 0 <= y < N

    def dfs(x, y, length, current_path):
        if length == k:
            if not min_path or current_path < min_path[0]:
                min_path.clear()
                min_path.append(current_path)
            return
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if isValidCell(nx, ny):
                dfs(nx, ny, length + 1, current_path + [grid[nx][ny]])

    for i in range(N):
        for j in range(N):
            dfs(i, j, 1, [grid[i][j]])

    return min_path[0]

