def encode(message):
    """
    Encodes a message by swapping case of all letters and replacing vowels with the letter 
    that appears 2 places ahead of that vowel in the English alphabet.
    """
    vowels = 'aeiouAEIOU'
    vowel_replacement = {'a': 'c', 'A': 'C', 'e': 'g', 'E': 'G', 'i': 'k', 'I': 'K', 'o': 'q', 'O': 'Q', 'u': 'w', 'U': 'W'}
    encoded_message = ''
    for ch in message:
        if ch in vowels:
            encoded_message += vowel_replacement[ch]
        elif ch.isalpha():
            if ch.islower():
                encoded_message += ch.upper()
            else:
                encoded_message += ch.lower()
        else:
            encoded_message += ch
    return encoded_message

