def minPath(grid, k):
    N = len(grid)
    min_path = [float('inf')] * k

    def neighbors(row, col):
        for r, c in ((row-1, col), (row+1, col), (row, col-1), (row, col+1)):
            if 0 <= r < N and 0 <= c < N:
                yield r, c

    def dfs(row, col, steps, path):
        nonlocal min_path
        if steps == k:
            min_path = min(min_path, path)
            return
        for r, c in neighbors(row, col):
            if (r, c) not in visited:
                visited.add((r, c))
                dfs(r, c, steps + 1, path + [grid[r][c]])
                visited.remove((r, c))

    for i in range(N):
        for j in range(N):
            visited = set([(i, j)])
            dfs(i, j, 1, [grid[i][j]])

    return min_path

