        else:
            if i == 1:
                tribonacci_seq.append(tribonacci_seq[i - 1])
            elif i == 2:
                tribonacci_seq.append(tribonacci_seq[i - 1] + tribonacci_seq[i - 2] + 1)
            else:
                tribonacci_seq.append(tribonacci_seq[i - 1] + tribonacci_seq[i - 2] + tribonacci_seq[i - 3])
    return tribonacci_seq

