def fix_spaces(text):
    """
    Given a string text, replace all spaces in it with underscores, 
    and if a string has more than 2 consecutive spaces, 
    then replace all consecutive spaces with - 
    """
    modified_text = ""
    count = 0
    for ch in text:
        if ch == " ":
            count += 1
        else:
            if count > 2:
                modified_text += "-"
            elif count > 0:
                modified_text += "_" * count
            count = 0
            modified_text += ch
    if count > 2:
        modified_text += "-"
    elif count > 0:
        modified_text += "_" * count
    return modified_text

