def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    best_path = [float('inf')] * k

    def dfs(row, col, length, current_path):
        if length == k:
            nonlocal best_path
            best_path = min(best_path, current_path)
            return
        for dr, dc in directions:
            new_row, new_col = row + dr, col + dc
            if 0 <= new_row < N and 0 <= new_col < N:
                dfs(new_row, new_col, length + 1, current_path + [grid[new_row][new_col]])

    for row in range(N):
        for col in range(N):
            dfs(row, col, 1, [grid[row][col]])

    return best_path

def tri(n):
