    if n == 0:
        return [3]
    seq = [3]
    for i in range(1, n + 1):
        if i % 2 == 0:
            seq.append(1 + i / 2)
        else:
            if i + 1 > len(seq):
                seq.append(seq[i - 1] + seq[i - 2] + 1 + (i + 1) / 2)
            else:
                seq.append(seq[i - 1] + seq[i - 2] + seq[i + 1])
    return seq

