def minPath(grid, k):
    from heapq import heappush, heappop
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    minHeap = [(grid[i][j], i, j, [grid[i][j]]) for i in range(N) for j in range(N)]
    minHeap.sort()
    for value, x, y, path in minHeap:
        if len(path) == k:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                newPath = path + [grid[nx][ny]]
                heappush(minHeap, (newPath[-1], nx, ny, newPath))

