def encode(message):
    def swap_case(ch):
        if ch.islower():
            return ch.upper()
        else:
            return ch.lower()

    def shift_vowel(vowel):
        vowels = 'aeiouAEIOU'
        shift = 2
        if vowel in vowels:
            is_upper = vowel.isupper()
            index = vowels.index(vowel.lower())
            new_vowel = vowels[(index + shift) % len(vowels) // 2]
            return new_vowel.upper() if is_upper else new_vowel
        return vowel

    encoded_message = ''
    for ch in message:
        if ch.isalpha():
            if ch.lower() in 'aeiou':
                shifted_vowel = shift_vowel(ch)
                encoded_message += swap_case(shifted_vowel)
            else:
                encoded_message += swap_case(ch)
        else:
            encoded_message += ch
    return encoded_message

