def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]
    min_path = [float('inf')] * k

    def dfs(x, y, path):
        nonlocal min_path
        if len(path) == k:
            min_path = min(min_path, path)
            return
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                dfs(nx, ny, path + [grid[nx][ny]])

    for i in range(N):
        for j in range(N):
            dfs(i, j, [grid[i][j]])

    return min_path

def tri(n):
    """Return the first n + 1 numbers of the Tribonacci sequence."""
    if n == 0:
        return [1]
    seq = [1, 3]
    for i in range(2, n + 1):
        if i % 2 == 0:
            seq.append(1 + i / 2)
        else:
            if len(seq) > i:
                seq.append(seq[i - 1] + seq[i - 2] + seq[i])
            else:
                seq.append(seq[i - 1] + seq[i - 2] + tri(i + 1)[i])
    return seq

